import React, { Component } from "react";
import TextField from '@material-ui/core/TextField';

class DateTimePicker extends Component  {
  constructor(props){
    super(props)
    this.state = {
      data : []
    }
  }

  getDateTimeValue(e){
  	let startDateTime = e.target.value
  	let endDateTime = e.target.value

  	let sTimeId = e.target.id
    // console.log(startDateTime)
  }


  render(){
      return (
        <form  >
            <TextField
				id="start-date"
				variant='outlined'
				label="Start"
				type="datetime-local"
				onChange={ e =>{this.getDateTimeValue(e)}}
				InputLabelProps={{ shrink: true,}}
             />
             <TextField
				id="end-date"
				variant='outlined'
				label="End"
				type="datetime-local"
				onChange={ e =>{this.getDateTimeValue(e)}}
				InputLabelProps={{ shrink: true,}}
             />

       </form>
      );
  }

}



export default DateTimePicker;
